import React, { Component } from 'react';

const Movie1=(props)=>{
const {movieId,movieName,movieGenre,movieRating}=props;
        return (
            <React.Fragment>
                <tr>
                    <th scope="row">movie number {movieId+1}</th>
                    <td>{movieId}</td>
                    <td>{movieName}</td>
                    <td>{movieGenre}</td>
                    <td>{movieRating}</td>
                </tr>
            </React.Fragment>
        );
}
export default Movie1;
